export type Fodselsnummertype =
  /**
   * Unik identifikator for en person i det norske folkeregisteret.
   * D-nummer er en midlertidig identifikator som gis etter visse vilkår til utenlandske statsborgere som skal oppholde
   * seg i Norge i en kortere periode, eller som ikke oppfyller kravene for å bli registrert som bosatt.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  | 'D_NUMMER'
  /**
   * Unik identifikator for en person i det norske folkeregisteret.
   * Gis til norske statsborgere, barn født i Norge og utlendinger registrert som bosatt i Norge.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  | 'FODSELSNUMMER'
  /**
   * Unik identifikator for en person på et gitt lærested.
   * Nummeret er en midlertidig identifikator som genereres for personer som ikke oppfyller kravet til å få SNR eller
   * D-nummer, eller der personens fødselsnummer, D-nummer eller SNR er ukjent.
   * Nummeret er ikke unikt på tvers av læresteder.
   * Personer med FS-fiktivt nummer kan normalt ikke registreres som studenter.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  | 'FS_FIKTIVT_NUMMER'
  /**
   * Unik identifikator for en person utstedt av Direktoratet for høyere utdanning og kompetanse.
   * SNR er en midlertidig identifikator som tildeles personer som (ennå) ikke oppfyller kravene til D-nummer, typisk
   * utenlandske personer som har søkt om opptak til høyere utdanning i Norge.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  | 'SNR';

