/** En vurderingsenhet representerer en konkret avvikling av en bestemt eksamen eller annen type vurdering, eller en del av en slik. */
export type Vurderingsenhet = Node & {
  /**
   * Antall kandidater
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  antallKandidater?: Maybe<Scalars['Int']['output']>;
  /**
   * Antall kandidater møtt på eksamen
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  antallKandidaterMott?: Maybe<Scalars['Int']['output']>;
  /**
   * Systemet eller mediet som brukes for å besvare en eksamen.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  eksamenssystem?: Maybe<Vurderingssystem>;
  /**
   * Emnet denne vurderingsenheten tilhører
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  emne: Emne;
  /**
   * Unik identifikator for vurderingsenheten.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  id: Scalars['ID']['output'];
  /**
   * Merknadstekst knyttet til vurderingsenheten. Vises fram på Studentweb
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  merknadForStudent?: Maybe<VurderingsenhetMerknadForStudent>;
  /**
   * Vurderingsperiode for gjennomføring av denne vurderingsenheten.
   * Kan avvike fra _vurderingsperiode_.
   * Ulike vurderingsenheter tilhørende samme vurderingsavvikling (og derfor med samme _vurderingsperiode_)
   * kan ha ulik reellVurderingsperiode.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  reellVurderingsperiode: Vurderingsperiode;
  /**
   * Protokollførte resultater knyttet til denne vurderingsenheten
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  resultater?: Maybe<Array<Maybe<Resultat>>>;
  /**
   * inneholder karakterfordeling og statistikk på antall bestått/stryk mm.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  resultatfordeling?: Maybe<Resultatfordeling>;
  /**
   * Informasjon knyttet til sensur av denne vurderingen.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  sensurinformasjon?: Maybe<Sensurinformasjon>;
  /**
   * Start- og slutt-termin for denne vurderingsenheten
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  terminPeriode: VurderingsenhetTerminperiode;
  /**
   * Trekkfristen for vurderingen.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  trekkfrist?: Maybe<Scalars['DateTime']['output']>;
  /** Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt). */
  vurderingsavviklingstype: Vurderingsavviklingstype;
  /**
   * Oversikt over studenter som er meldt til vurderingen.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  vurderingsmeldinger: Array<Vurderingsmelding>;
  /**
   * Vurderingsoppbygningsdelen denne vurderingsenheten tilhører
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  vurderingsoppbygningsdel: Vurderingsoppbygningsdel;
  /**
   * Vurderingsperiode for vurderingsenheten.
   * Vurderingsenheter som tilhører samme avvikling av vurdering for et emne har samme oppmeldingsperiode.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  vurderingsperiode: Vurderingsperiode;
  /**
   * Informasjon om hvor lenge vurderingen varer.
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  vurderingsvarighet?: Maybe<Vurderingsvarighet>;
};

