  /**
   * Angir hvilket system begrunnelse skal gis i
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  begrunnelsessystem?: Maybe<Vurderingssystem>;
  /**
   * Angir om studenten selv kan velge campus for gjennomføring
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  campusErValgbar?: Maybe<Scalars['Boolean']['output']>;
  /**
   * Angir hvilke campus vurderingen tilbys ved
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  campuser?: Maybe<Array<Maybe<VurderingskombinasjonCampus>>>;
  /**
   * Angir hvordan eksamen skal gjennomføres for vurderingsoppbygningsdelen
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
  eksamensgjennomforing?: Maybe<VurderingsoppbygningsdelEksamensgjennomforing>;
  /**
   * Angir hvilket eksamenssystem som brukes for vurdering
   *
   * Denne funksjonaliteten er en del av [experimental](https://studieadministrasjon.sikt.no/apier/#kontrakt-for-apier-med-status-eksperimentelt).
   */
